import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { Box,    Typography,
    Card,
    CardContent,
    CardActions,
    Button,
    Grid,
} from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
    palette: {
        background: {
            default: '#282c34',
        },
    },
    components: {
        MuiOutlinedInput: {
            styleOverrides: {
                root: {
                    '& .MuiOutlinedInput-notchedOutline': {
                        borderColor: 'white',
                    },
                    '&:hover .MuiOutlinedInput-notchedOutline': {
                        borderColor: 'white',
                    },
                    '&.Mui-focused .MuiOutlinedInput-notchedOutline': {
                        borderColor: 'white',
                    },
                    color: 'white',
                },
                input: {
                    color: 'white',
                },
                notchedOutline: {
                    borderColor: 'white',
                },
            },
        },
        MuiInputLabel: {
            styleOverrides: {
                root: {
                    color: 'white',
                },
            },
        },
    },
});

const getPersonList = async (userId) => {
    const BASE_URL = 'https://peoplemuseumyeah.uc.r.appspot.com/db';

    try {
        const response = await axios.post(`${BASE_URL}/getPersonList`, {
            userId,
        }, {
            headers: {
                'Content-Type': 'application/json',
            },
        });
        console.log('Status:', response.status);
        console.log('Data:', response.data);
        return response;
    } catch (error) {
        console.error('Error:', error.message);
        if (error.response) {
            console.error('Status:', error.response.status);
            console.error('Data:', error.response.data);
        } else if (error.request) {
            console.error('No response received:', error.request);
        } else {
            console.error('Error setting up request:', error.message);
        }
        throw error;
    }
};

const deletePerson = async (personId) => {
    const BASE_URL = 'https://peoplemuseumyeah.uc.r.appspot.com/db';

    try {
        const response = await axios.delete(`${BASE_URL}/deletePerson`, {
            data: { personId },
            headers: {
                'Content-Type': 'application/json',
            },
        });
        console.log('Status:', response.status);
        console.log('Data:', response.data);
        return response;
    } catch (error) {
        console.error('Error:', error.message);
        if (error.response) {
            console.error('Status:', error.response.status);
            console.error('Data:', error.response.data);
        } else if (error.request) {
            console.error('No response received:', error.request);
        } else {
            console.error('Error setting up request:', error.message);
        }
        throw error;
    }
};

const PersonList = () => {
    const userId = '1'; // Hardcoded userId as a string for demonstration
    const [people, setPeople] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchPeople = async () => {
            try {
                const response = await getPersonList(userId);

                if (response && response.data && response.data.data) {
                    setPeople(response.data.data);
                } else {
                    console.log('No data returned');
                }
            } catch (error) {
                console.error('Error fetching people:', error);
                setError(error.message);
            } finally {
                setLoading(false);
            }
        };

        fetchPeople();
    }, []);

    const handleDelete = async (personId) => {
        try {
            await deletePerson(personId);
            setPeople(people.filter((person) => person.personId !== personId));
        } catch (error) {
            console.error('Error deleting person:', error);
        }
    };

    if (loading) {
        return (
            <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
                Loading...
            </Box>
        );
    }

    if (error) {
        return (
            <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
                Error: {error}
            </Box>
        );
    }

    return (
        <ThemeProvider theme={theme}>
            <Box
                sx={{
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                    minHeight: '100vh',
                    p: 2,
                }}
            >
                <Typography variant="h4" gutterBottom color="primary" sx={{ textAlign: 'center' }}>
                    People List
                </Typography>
                <Button
                    component={Link}
                    to="/add-person"
                    variant="contained"
                    color="primary"
                    sx={{ marginBottom: 2 }}
                >
                    Add Person
                </Button>
                <Grid container spacing={2} justifyContent="center">
                    {people.length > 0 ? (
                        people.map((person) => (
                            <Grid item key={person.personId}>
                                <Card sx={{ maxWidth: 300, marginBottom: 2 }}>
                                    <CardContent>
                                        <Typography variant="h6" gutterBottom color="white">
                                            {person.name}
                                        </Typography>
                                        <Typography variant="body2" color="white">
                                            Description: {person.description}
                                        </Typography>
                                    </CardContent>
                                    <CardActions>
                                        <Button
                                            component={Link}
                                            to={`/update-person/${person.personId}`}
                                            variant="outlined"
                                            color="primary"
                                            sx={{ marginRight: 1 }}
                                        >
                                            Update
                                        </Button>
                                        <Button
                                            variant="outlined"
                                            color="secondary"
                                            onClick={() => handleDelete(person.personId)}
                                        >
                                            Delete
                                        </Button>
                                    </CardActions>
                                </Card>
                            </Grid>
                        ))
                    ) : (
                        <Typography variant="h6" color="text.secondary" sx={{ textAlign: 'center' }}>
                            No people found
                        </Typography>
                    )}
                </Grid>
            </Box>
        </ThemeProvider>
    );
};

export default PersonList;
